/**
 * @param {string} s
 * @return {number}
 */
const lengthOfLongestSubstring = function(s) {
    return solution2(s);
};

const solution = (s) => {
    let maxLength = 0;
    let head = 0;
    let map = {};
    for (let i = 0; i < s.length; i++) {
        const char = s[i];
        const lastPosition = map[char];
        map[char] = i;
        const length = i - head + 1;
        if (lastPosition >= head) {
            maxLength = Math.max(length - 1, maxLength);
            head = lastPosition + 1;
            continue;
        }
        maxLength = Math.max(length, maxLength);
    }
    return maxLength;
};

const solution2 = (s) => {
    let max = 0;
    let head = 0;
    for (let i = 0; i < s.length; i++) {
        const substring = s.substring(head, i);
        const position = substring.indexOf(s[i]);
        if (position !== -1) {
            head += position + 1;
        }
        max = Math.max(max, i - head + 1);
    }
    return max;
};

